from pybricks.parameters import Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase
from pybricks.tools import multitask, run_task, wait

# Set up all devices.
right = Motor(Port.A, Direction.CLOCKWISE)
left = Motor(Port.B, Direction.COUNTERCLOCKWISE)
front = Motor(Port.E, Direction.CLOCKWISE)
back = Motor(Port.F, Direction.CLOCKWISE)
drive_base = DriveBase(left, right, 81.6, 110)

async def main():
    print('Hello, Pybricks!')
    # Initial Position: The back is on the cross between the thin curve and
    # the second line. definition of "second line": the line right behind
    # the big boat, not the banana boat. Side wheel secure bar is lined up
    # with the wall. Coral: in front.  DO NOT FORGET ANYTHING ON THE
    # ATTACHMENTS!!! please and thank you :) p.s. it works.
    drive_base.use_gyro(True)
    drive_base.settings(straight_speed=100)
    await drive_base.straight(-50)
    await multitask(back.run_angle(100, -100), front.run_angle(40, -47))
    await wait(1000)
    drive_base.settings(straight_speed=1000)
    await drive_base.curve(64.987654321, 180)
    await drive_base.straight(117.8)
    # Instead of 60 degree, here we use 50 degree so that
    await front.run_angle(150, 50)
    await drive_base.straight(210)
    # 400 degree/seconds is important for the shark delivery
    await front.run_angle(500, -120)
    # This backup is to allow the bar to
    await drive_base.straight(-173)
    await front.run_angle(200, 120)
    await drive_base.straight(300)
    await front.run_angle(500, -60)
    drive_base.settings(straight_speed=500)
    await drive_base.curve(-90, 182)
    await drive_base.straight(-250)
    await drive_base.straight(90)
    await drive_base.curve(140, 180)
    await drive_base.straight(550, Stop.NONE)
    await drive_base.curve(250, 60)


run_task(main())